import React, { Component } from 'react';
import { View, Text, } from 'react-native';

export default class DetailScreen extends Component {
    constructor(props){
        super(props);
        this.state = {
            temp : null,
            hum : null,

        }
    }

    componentMount(){
        return fetch("http://api.openweathermap.org/data/2.5/weather?q="+this.props.route.params.text+"&appid=e5ea91bc97a4a071bfb4d4d27fe05ae1")
        .then( (response) => response)
    }

  render() {
      const d = "http://api.openweathermap.org/data/2.5/weather?q="+this.props.route.params.text+"&appid=e5ea91bc97a4a071bfb4d4d27fe05ae1";
      const data = fetch(d).then((response) => response.json()).then((data) => console.log(data));
    return (
      <View>
        <Text style={{fontSize:30}}>How is the Weather today</Text>
        <Text>검색한 도시</Text>
        <Text style={{fontSize:30, backgroundColor: '#aaaaaa', borderRadius: 5, padding:5, margin:5}}>
          {d}
          {data}
        </Text>
      </View>
    );
  }
}
